import React from 'react'
import Card from "./Card"

function BotList({ botlist, action, removeCard }) {
  const displayCards =  botlist ? botlist.map(bot => {
    return <Card bot={bot} action={action} removeCard={removeCard} />
  }):null;

  return (
    <div className="ui four column grid">
      <div className="row">
        {displayCards}
        You have recruitment is complete .
      </div>
    </div>
  )
}
export default BotList;
